export declare function createDataResource(uri: LeafUri, overwrite?: boolean, options?: DatasetRequestOptions): Promise<LeafCreateIfAbsentResult | LeafCreateAndOverwriteResult>;
export declare function createDataResource(uri: string, overwrite: true, options?: DatasetRequestOptions): Promise<ContainerCreateAndOverwriteResult | LeafCreateAndOverwriteResult>;
